	function sbSVGify(elem) {
		if (sb_instagram_js_options.font_method != 'fontfile') {
			if (typeof elem === 'undefined') {
				elem = jQuery('.sbi')
			}
			elem.each(function () {
				jQuery(this).find('i.fa').each(function () {
					var faClass = jQuery(this).attr('class').match(/fa-[a-z-]+/),
						styles = jQuery(this).attr('style');
					if (faClass && typeof sbIconSVG[faClass[0]] !== 'undefined') {
						var theStyle = typeof styles !== 'undefined' ? 'style="' + styles + '" ' : '';
						jQuery(this).replaceWith('<svg ' + theStyle + sbIconSVG[faClass[0]])
					} else {
						console.log(faClass, 'missing')
					}
				})
			});
			sbiSizeSVG(elem)
		}
	}

	function sbiSizeSVG(elem) {
		if (elem.find('svg').innerWidth() > 48 || elem.find('.sbi_follow_btn svg').innerWidth() > 30 || elem.find('.fa-clone').last().innerWidth() > 24 || elem.find('.fa-play').last().innerWidth() > 48) {
			jQuery('.sbi_follow_btn svg').css({
				'margin-bottom': '-4px',
				'margin-right': '7px',
				'font-size': '15px',
				'width': '15px'
			});
			elem.find('.fa-spinner').css({
				'font-size': '15px',
				'width': '15px'
			});
			if (elem.find('.sbi_type_carousel .fa-clone').length) {
				elem.find('.sbi_type_carousel .fa-clone').each(function () {
					var size = '24px',
						offset = '8px';
					if (elem.hasClass('sbi_small')) {
						size = '12px';
						offset = '5px'
					} else if (elem.hasClass('sbi_medium')) {
						size = '18px';
						offset = '5px'
					}
					jQuery(this).css({
						'top': offset,
						'right': offset,
						'position': 'absolute',
						'font-size': size,
						'width': size,
						'color': '#fff',
						'-webkit-filter': 'drop-shadow( 0px 0px 2px rgba(0,0,0,.4) )',
						'filter': 'drop-shadow( 0px 0px 2px rgba(0,0,0,.4) )'
					})
				})
			}
			if (elem.find('.sbi_item .fa-play').length) {
				elem.find('.sbi_item .fa-play').each(function () {
					var size = '48px',
						margintop = '-24px',
						marginleft = '-19px';
					if (jQuery(this).closest('.sbi').hasClass('sbi_small')) {
						size = '18px';
						margintop = '-9px';
						marginleft = '-7px'
					} else if (jQuery(this).closest('.sbi').hasClass('sbi_medium')) {
						size = '23px';
						margintop = '-12px';
						marginleft = '-10px'
					}
					jQuery(this).css({
						'top': '50%',
						'right': '50%',
						'position': 'absolute',
						'font-size': size,
						'width': size,
						'margin-top': margintop,
						'margin-left': marginleft,
						'color': '#fff',
						'-webkit-filter': 'drop-shadow( 0px 0px 2px rgba(0,0,0,.4) )',
						'filter': 'drop-shadow( 0px 0px 2px rgba(0,0,0,.4) )'
					})
				})
			}
		}
	}
	var addLinks = {
		regexString: "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/=",
		hashtags: function (e) {
			var t = "";
			var n, r, i, s, o, u, a;
			var f = 0;
			e = addLinks._utf8_encode(e);
			while (f < e.length) {
				n = e.charCodeAt(f++);
				r = e.charCodeAt(f++);
				i = e.charCodeAt(f++);
				s = n >> 2;
				o = (n & 3) << 4 | r >> 4;
				u = (r & 15) << 2 | i >> 6;
				a = i & 63;
				if (isNaN(r)) {
					u = a = 64
				} else if (isNaN(i)) {
					a = 64
				}
				t = t + this.regexString.charAt(s) + this.regexString.charAt(o) + this.regexString.charAt(u) + this.regexString.charAt(a)
			}
			return t
		},
		handles: function (e) {
			var t = "";
			var n, r, i;
			var s, o, u, a;
			var f = 0;
			e = e.replace(/[^A-Za-z0-9+/=]/g, "");
			while (f < e.length) {
				s = this.regexString.indexOf(e.charAt(f++));
				o = this.regexString.indexOf(e.charAt(f++));
				u = this.regexString.indexOf(e.charAt(f++));
				a = this.regexString.indexOf(e.charAt(f++));
				n = s << 2 | o >> 4;
				r = (o & 15) << 4 | u >> 2;
				i = (u & 3) << 6 | a;
				t = t + String.fromCharCode(n);
				if (u != 64) {
					t = t + String.fromCharCode(r)
				}
				if (a != 64) {
					t = t + String.fromCharCode(i)
				}
			}
			t = addLinks._utf8_decode(t);
			return t
		},
		_utf8_encode: function (e) {
			e = e.replace(/rn/g, "n");
			var t = "";
			for (var n = 0; n < e.length; n++) {
				var r = e.charCodeAt(n);
				if (r < 128) {
					t += String.fromCharCode(r)
				} else if (r > 127 && r < 2048) {
					t += String.fromCharCode(r >> 6 | 192);
					t += String.fromCharCode(r & 63 | 128)
				} else {
					t += String.fromCharCode(r >> 12 | 224);
					t += String.fromCharCode(r >> 6 & 63 | 128);
					t += String.fromCharCode(r & 63 | 128)
				}
			}
			return t
		},
		_utf8_decode: function (e) {
			var t = "";
			var n = 0;
			var r = c1 = c2 = 0;
			while (n < e.length) {
				r = e.charCodeAt(n);
				if (r < 128) {
					t += String.fromCharCode(r);
					n++
				} else if (r > 191 && r < 224) {
					c2 = e.charCodeAt(n + 1);
					t += String.fromCharCode((r & 31) << 6 | c2 & 63);
					n += 2
				} else {
					c2 = e.charCodeAt(n + 1);
					c3 = e.charCodeAt(n + 2);
					t += String.fromCharCode((r & 15) << 12 | (c2 & 63) << 6 | c3 & 63);
					n += 3
				}
			}
			return t
		}
	}

